import { State, Action, StateContext } from '@ngxs/store';
import * as AppDataActions from './app-data.actions';
import { Injectable } from '@angular/core';
import { AppDataStateModel } from '@store/app-data/app-data.model';
import { UserState } from '@store/user';
import { AgenciesState } from '@store/agencies';
import { PreferencesState } from '@store/preferences';

@State<AppDataStateModel>({
  name: 'appData',
  defaults: {
    id: '',
  },
  children: [UserState, AgenciesState, PreferencesState],
})
@Injectable()
export class AppDataState {
  constructor() {}

  @Action(AppDataActions.Add)
  addAppData(
    ctx: StateContext<AppDataStateModel>,
    { payload }: AppDataActions.Add
  ): void {
    ctx.patchState({
      ...payload,
    });
  }

  @Action(AppDataActions.Edit)
  updateAppData(
    ctx: StateContext<AppDataStateModel>,
    { payload }: AppDataActions.Edit
  ): void {
    ctx.patchState({
      ...payload,
    });
  }

  @Action(AppDataActions.Delete)
  deleteAppData(
    ctx: StateContext<AppDataStateModel>,
    {}: AppDataActions.Delete
  ): void {
    const state = ctx.getState();
    const payload = new AppDataStateModel();
    ctx.setState({
      ...state,
      ...payload,
    });
  }
}

import { Injectable } from '@angular/core';
import Auth, { CognitoHostedUIIdentityProvider } from '@aws-amplify/auth';
import { Hub, ICredentials } from '@aws-amplify/core';
import { Subject, Observable, Subscription } from 'rxjs';
import {
  CognitoUser,
  CognitoUserSession,
  ISignUpResult,
} from 'amazon-cognito-identity-js';
import { SyncService } from '@shared/services/sync/sync.service';
import { Store } from '@ngxs/store';
import { Router } from '@angular/router';

export interface NewUser {
  username: string;
  password: string;
}

@Injectable({
  providedIn: 'root',
})
export class AuthService {
  public static SIGN_IN = 'signIn';
  public static SIGN_OUT = 'signOut';
  public static FACEBOOK = CognitoHostedUIIdentityProvider.Facebook;
  public static GOOGLE = CognitoHostedUIIdentityProvider.Google;

  constructor(private sync: SyncService, private router: Router) {
    Hub.listen('auth', async (data) => {
      const { channel, payload } = data;
      switch (payload.event) {
        case 'signIn':
          console.log('in signin');
          const creds: ICredentials = await this.getCurrentUserCredentials();
          console.log('current credentials', creds);
          if (creds) await this.sync.hallmonitor(creds);
          break;
        case 'signOut':
          // handle sign out
          break;
        default:
          // do something by default
          break;
      }
    });

    Auth.currentAuthenticatedUser()
      .then(async (user) => {
        console.log('authenticated user');
        const creds: ICredentials = await this.getCurrentUserCredentials();
        if (creds) await this.sync.hallmonitor(creds);
      })
      .catch(() => console.log('Not signed in'));
  }

  /**
   * This method is designed to help reload the user if the ID ever goes null
   * will perform the following:
   *  1. Get current credentials (if the token is still valid)
   *  2. If no token available, and on a different page...go back to login
   *  3. If on sign in or sign up...do nothing
   * @returns
   */
  async reloadCredentials(): Promise<void> {
    const creds = await this.getCurrentUserCredentials();
    if (creds) {
      await this.sync.hallmonitor(creds);
    } else {
      switch (this.router.url) {
        case '/auth/signin':
          break;
        case '/auth/signup':
          break;
        case '/signin':
          break;
        case '/signin':
          break;
        default:
          this.router.navigate(['/auth/signin']);
          break;
      }
    }
  }

  /**
   * Cognito sign up method
   * @param {NewUser} user
   * @returns
   */
  signUp(user: NewUser): Promise<ISignUpResult> {
    return Auth.signUp({
      username: user.username,
      password: user.password,
      attributes: {
        email: user.username,
      },
    });
  }

  /**
   * Cognito sign in method
   * @param {string} username
   * @param {string} password
   * @returns
   */
  signIn(username: string, password: string): Promise<CognitoUser | any> {
    return new Promise((resolve, reject) => {
      Auth.signIn(username, password)
        .then((user: CognitoUser | any) => {
          resolve(user);
        })
        .catch((error: any) => reject(error));
    });
  }

  /**
   * Simple sign out method
   * @returns
   */
  signOut(): Promise<any> {
    return Auth.signOut();
  }

  /**
   * Social signin (supports facebook and google)
   * @param {CognitoHostedUIIdentityProvider} provider
   * @returns
   */
  socialSignIn(
    provider: CognitoHostedUIIdentityProvider
  ): Promise<ICredentials> {
    return Auth.federatedSignIn({
      provider: provider,
    });
  }

  /**
   *
   * @param {string} email
   * @returns
   */
  resendSignUp(email: string): Promise<string> | undefined {
    return email ? Auth.resendSignUp(email) : undefined;
  }

  /**
   *
   * @param email
   * @param code
   * @param pw
   * @returns
   */
  forgotPasswordSubmit(
    email: string,
    code: string,
    pw: string
  ): Promise<void> | undefined {
    return email
      ? Auth.forgotPasswordSubmit(email.toLowerCase(), code, pw)
      : undefined;
  }

  /**
   * Get authenticated credentials of current user.
   * @return - A promise resolves to be current user's credentials
   */
  getCurrentUserCredentials(): Promise<ICredentials> {
    return Auth.currentUserCredentials();
  }

  /**
   * Get current authenticated user
   * @return - A promise resolves to current authenticated CognitoUser if success
   */
  getCurrentAuthenticatedUser(): Promise<CognitoUser> {
    return Auth.currentAuthenticatedUser();
  }

  /**
   *
   * @returns
   */
  refreshSession(): Promise<CognitoUserSession> {
    return Auth.currentSession();
  }

  /**
   *
   */
  async getAuthTokens(): Promise<string> {
    try {
      const user: CognitoUser = await Auth.currentAuthenticatedUser();
      let session = user.getSignInUserSession();
      return session ? session.getIdToken().getJwtToken() : '';
    } catch (err) {
      return '';
    }
  }

  /**
   *
   */
  async getAuthCredentials(): Promise<ICredentials | null> {
    try {
      const creds: ICredentials = await Auth.currentUserCredentials();
      return creds;
    } catch (err) {
      return null;
    }
  }
}

import { Injectable, OnDestroy } from '@angular/core';
import { Select, Store } from '@ngxs/store';
import {
  IBorrower,
  IMergeReport,
  ITradeLinePartition,
  IUnparsedCreditReport,
} from '@shared/interfaces/merge-report.interface';
import { AgenciesState, AgenciesStateModel } from '@store/agencies';
import { Observable, Subject, Subscription } from 'rxjs';
import * as parser from 'fast-xml-parser';
import { TransunionInput } from '@shared/services/aws/api.service';
import { PreferencesState, PreferencesStateModel } from '@store/preferences';

const parserOptions = {
  attributeNamePrefix: '',
  ignoreAttributes: false,
  ignoreNameSpace: true,
  parseAttributeValue: true,
};

/**
 * Service to parse and pull information from credit reports
 */
@Injectable({
  providedIn: 'root',
})
export class CreditreportService implements OnDestroy {
  tuReport: IMergeReport = {} as IMergeReport;
  tuReport$: Subject<IMergeReport> = new Subject();
  tuAgency: TransunionInput = {} as TransunionInput;
  tuAgency$: Subject<TransunionInput> = new Subject();
  tuPreferences: PreferencesStateModel = {} as PreferencesStateModel;
  tuPreferences$: Subject<PreferencesStateModel> = new Subject();

  @Select(AgenciesState) agencies$!: Observable<AgenciesStateModel>;
  agenciesSub$: Subscription;

  @Select(PreferencesState) preferences$!: Observable<PreferencesStateModel>;
  preferencesSub$: Subscription;

  constructor() {
    this.agenciesSub$ = this.agencies$
      .pipe()
      .subscribe((agencies: AgenciesStateModel) => {
        const tu = this.getTransunion(agencies);
        this.tuAgency$.next(tu);
        this.tuAgency = tu;
        const unparsed = this.getUnparsedCreditReport(agencies);
        const parsedReport = this.parseCreditReport(unparsed['#text']);
        this.tuReport$.next(parsedReport);
        this.tuReport = parsedReport;
      });
    this.preferencesSub$ = this.preferences$
      .pipe()
      .subscribe((pref: PreferencesStateModel) => {
        this.tuPreferences$.next(pref);
        this.tuPreferences = pref;
      });
  }

  ngOnDestroy(): void {
    if (this.agenciesSub$) this.agenciesSub$.unsubscribe();
    if (this.preferencesSub$) this.preferencesSub$.unsubscribe();
  }

  /**
   * Return the TU data from provided agency state model
   * @param {AgenciesStateModel} agencies
   * @returns
   */
  getTransunion(agencies: AgenciesStateModel): TransunionInput {
    if (!agencies.transunion) return {} as TransunionInput;
    return agencies.transunion;
  }

  /**
   * Takes the agency state model and returns the unparsed TU credit report
   *   - TUCredit report agency stored as AWS JSON string in DB
   * @param {AgenciesStateModel} agencies
   * @returns
   */
  getUnparsedCreditReport(agencies: AgenciesStateModel): IUnparsedCreditReport {
    if (!agencies) return JSON.parse('{"#text":""}');
    const serviceProductString =
      agencies.transunion?.enrollMergeReport?.serviceProductObject ||
      '{"#text":""}';
    const serviceProductObject: IUnparsedCreditReport = JSON.parse(
      serviceProductString
    );
    return serviceProductObject
      ? serviceProductObject
      : ({} as IUnparsedCreditReport);
  }

  /**
   * Parses the xml string into a JSON object of the IMergeReport form
   * @param {string} xml
   * @returns
   */
  parseCreditReport(xml: string): IMergeReport {
    const clean = xml
      .replace(/&lt;/g, '<')
      .replace(/&gt;/g, '>')
      .replace(/&#xD;/g, '');
    const report: IMergeReport = parser.parse(clean, parserOptions);
    return report;
  }

  /**
   * Returns the tradeline partitions from the current TU report
   * @returns
   */
  getTradeLinePartitions(): ITradeLinePartition[] {
    if (!this.tuReport) return [{} as ITradeLinePartition];
    const partitions = this.tuReport?.TrueLinkCreditReportType
      ?.TradeLinePartition;
    if (!partitions) return [{} as ITradeLinePartition];
    return partitions instanceof Array ? partitions : [partitions];
  }

  /**
   * Returns the borrower from the current TU report
   */
  getBorrower(): IBorrower {
    if (!this.tuReport) return {} as IBorrower;
    const borrower = this.tuReport?.TrueLinkCreditReportType?.Borrower;
    return borrower ? borrower : ({} as IBorrower);
  }
}

