    });
  }

  /**
   *
   * @param agencies
   */
  updateAgencies(agencies: AgenciesStateModel | undefined): void {
    if (!agencies) return;
    this.store
      .dispatch(new AgenciesActions.Edit(agencies))
      .subscribe((state: { appData: AppDataStateModel }) => {
