    //     // const data: any = resp.value?.data?.onDeleteAppData;
    //     // console.log('on create listener', data);
    //   }
    // );
  }

  /**
   * Hall monitor. Checks the user and tells them where to go when they come back
   *   to the app for the first and subsequent times.
   *   Called when:
   *    1. User signs in
   *    2. User refreshes (and auth service reinitiates via Auth.currentCredentials())
   * @returns
   */
  async hallmonitor(creds: ICredentials): Promise<void> {
    console.log('calling hallmonitor');
    const { identityId: id } = creds;
    console.log('id', id);
    const data = await this.api.GetAppData(id); // check database for data
    if (!data) {
      // new user...seed database...and send them to onboarding
      await this.initAppData({ identityId: id } as ICredentials);
      this.routeUser(-1);
    } else {
      // existing user...check where last left off
      this.syncDBDownToState(id).then((state: AppDataStateModel) => {
        console.log('synching database to state', state);
        const lastComplete = state.user?.onboarding?.lastComplete || -1;
        this.routeUser(lastComplete);
      });
    }
  }

  /**
   * Seed the database with the basic credentials when the user signs up
   * @param {ICredentials} creds
   */
  async initAppData(
    creds: ICredentials
  ): Promise<CreateAppDataMutation | undefined> {
    try {
      const input: CreateAppDataInput = {
        id: creds.identityId,
        user: {
          id: creds.identityId,
          onboarding: {
            lastActive: 0,
            lastComplete: -1,
            started: true,
          },
        },
        agencies: {
          transunion: { authenticated: false },
          experian: { authenticated: false },
          equifax: { authenticated: false },
        },
        preferences: {
          showAllAccounts: {
            creditCards: false,
            collectionsAccounts: false,
            installmentLoans: false,
            mortgages: false,
          },
        },
      };
      console.log('input', input);
      const data = await this.api.CreateAppData(input);
      const clean = this.cleanBackendData(data);
      await this.store.dispatch(new AppDataActions.Add(clean));
      return data;
    } catch (err) {
      console.log('initApp error', err);
      return;
    }
  }

  /**
   * Takes the last completed step by the user and routes them to
   *   where they left off if they haven't finishd onboarding
   * @param {number} lastComplete
   */
  routeUser(lastComplete: number): void {
    switch (lastComplete) {
      case -1:
        this.router.navigate(['/onboarding/name']);
        break;
      case 0:
        this.router.navigate(['/onboarding/address']);
        break;
      case 1:
        this.router.navigate(['/onboarding/identity']);
        break;
      case 2:
        this.router.navigate(['/onboarding/verify']);
        break;
      default:
        // nothing to do, stay on same route
        break;
    }
  }

  /**
   * Update the state with updated db data
   *   - will use the provided state or if none provided,
   *     will select the state from the DB
   * @param {string} id user id
   * @param {AppDataStateModel} payload (optional)
   */
  async syncDBDownToState(
    id: string,
    payload?: AppDataStateModel
  ): Promise<AppDataStateModel> {
    console.log('payload in sync db', payload);
    if (payload) {
      console.log('editing state with provided payload');
      this.store.dispatch(new AppDataActions.Edit(payload));
      return payload;
    }
    // no payload need to get the id
    try {
      const raw = await this.api.GetAppData(id);
      const data = this.cleanBackendData(raw);
      return new Promise((resolve, reject) => {
        this.store.dispatch(new AppDataActions.Edit(data)).subscribe((_) => {
          resolve(data);
        });
      });
    } catch (err) {
      throw 'Error syncing db to state';
    }
  }

  cleanBackendData(data: GetAppDataQuery): AppDataStateModel {
    let clean = deleteKeyNestedObject(data, '__typename');
    delete clean.createdAt; // this is a graphql managed field
    delete clean.updatedAt; // this is a graphql managed field
    delete clean.owner; // this is a graphql managed field
    return clean;
  }
}

import { Injectable } from '@angular/core';
import { IEnrollRequest } from '@shared/interfaces/enroll-rquest.interface';
import { IVerifyAuthenticationAnswer } from '@shared/interfaces/verify-authentication-answers.interface';
import { IVerifyAuthenticationQuestionsMsg } from '@shared/interfaces/verify-authentication-questions.interface';
import { IGetAuthenticationQuestionsMsg } from '@shared/models/get-authorization-questions';
import { IIndicativeEnrichmentMsg } from '@shared/models/indicative-enrichment';
import { SsnInput, UpdateAppDataInput } from '@shared/services/aws/api.service';
import { AppDataStateModel } from '@store/app-data';

@Injectable({
  providedIn: 'root',
})
export class TransunionService {
  constructor() {}

  /**
   * Generates the message payload for TU services
   * @param {UpdateAppDataInput | AppDataStateModel} data
   * @returns
   */
  createIndicativeEnrichmentPayload(
    data: UpdateAppDataInput | AppDataStateModel
  ): IIndicativeEnrichmentMsg | undefined {
    const id = data.id?.split(':').pop();
    const attrs = data.user?.userAttributes;
    const dob = attrs?.dob;

    if (!attrs || !id || !dob) {
      console.log(`no attrs, id, or dob: attrs=${attrs}; id=${id}; dob=${dob}`);
      return;
    }

    return {
      AdditionalInputs: {
        Data: {
          Name: 'CreditReportVersion',
          Value: '1',
        },
      },
      RequestKey: '',
      ClientKey: id,
      Customer: {
        CurrentAddress: {
          AddressLine1: attrs.address?.addressOne || '',
          AddressLine2: attrs.address?.addressTwo || '',
          City: attrs.address?.city || '',
          State: attrs.address?.state || '',
          Zipcode: attrs.address?.zip || '',
        },
        PreviousAddress: {},
        DateOfBirth:
          `${attrs.dob?.year}-${
            monthMap[dob.month.toLowerCase()]
          }-${`0${dob.day}`.slice(-2)}` || '',
        FullName: {
          FirstName: attrs.name?.first || '',
          LastName: attrs.name?.last || '',
          MiddleName: attrs.name?.middle || '',
          Prefix: null,
          Suffix: null,
        },
        Ssn: `000000000${attrs.ssn?.lastfour}`.slice(-9) || '',
      },
      ServiceBundleCode: 'CC2BraveCreditIndicativeEnrichment',
    } as IIndicativeEnrichmentMsg;
  }

  /**
   * Generates the message payload for TU services
   * @param {UpdateAppDataInput | AppDataStateModel} data
   * @param {string} ssn
   * @returns
   */
  createGetAuthenticationQuestionsPayload(
    data: UpdateAppDataInput | AppDataStateModel,
    ssn: string = ''
  ): IGetAuthenticationQuestionsMsg | undefined {
    const id = data.id?.split(':')?.pop();
    const attrs = data.user?.userAttributes;
    const dob = attrs?.dob;

    if (!attrs || !id || !dob) {
      console.log(`no attrs, id, or dob: attrs=${attrs}; id=${id}; dob=${dob}`);
      return;
    }

    return {
      AdditionalInputs: {
        Data: {
          Name: 'CreditReportVersion',
          Value: '1',
        },
      },
      RequestKey: '',
      ClientKey: id,
      Customer: {
        CurrentAddress: {
          AddressLine1: attrs.address?.addressOne || '',
          AddressLine2: attrs.address?.addressTwo || '',
          City: attrs.address?.city || '',
          State: attrs.address?.state || '',
          Zipcode: attrs.address?.zip || '',
        },
        PreviousAddress: {},
        DateOfBirth:
          `${attrs.dob?.year}-${
            monthMap[dob?.month?.toLowerCase() || '']
          }-${`0${dob.day}`.slice(-2)}` || '',
        FullName: {
          FirstName: attrs.name?.first || '',
          LastName: attrs.name?.last || '',
          MiddleName: attrs.name?.middle || '',
        },
        PhoneNumber: attrs.phone?.primary || '',
        Ssn: ssn || '',
      },
      ServiceBundleCode: 'CC2BraveCreditAuthentication',
    } as IGetAuthenticationQuestionsMsg;
  }

  /**
   * Generates the message payload for TU services
   * @param {UpdateAppDataInput | AppDataStateModel} data
   * @param {IVerifyAuthenticationAnswer[]} answers
   * @returns
   */
  createVerifyAuthenticationQuestionsPayload(
    data: UpdateAppDataInput | AppDataStateModel,
    answers: IVerifyAuthenticationAnswer[]
  ): IVerifyAuthenticationQuestionsMsg | undefined {
    const id = data.id?.split(':')?.pop();

    if (!id || !answers.length) {
      console.log(
        `no id or answers provided: id=${id}; answers=${answers.length}`
      );
      return;
    }

    return {
      RequestKey: '',
      ClientKey: id,
      Answers: answers,
      ServiceBundleFulfillmentKey:
        data.agencies?.transunion?.serviceBundleFulfillmentKey || '',
    } as IVerifyAuthenticationQuestionsMsg;
  }

  /**
   * Genarates the message payload for TU service
   * @param { UpdateAppDataInput | AppDataStateModel} data
   * @returns
   */
  createEnrollPayload(
    data: UpdateAppDataInput | AppDataStateModel
  ): IEnrollRequest | undefined {
    const id = data.id?.split(':')?.pop();
    const attrs = data.user?.userAttributes;
    const dob = attrs?.dob;

    if (!id || !attrs || !dob) {
      console.log(
        `no id, attributes, or dob provided: id=${id},  attrs=${attrs}, dob=${dob}`
      );
      return;
    }

    return {
      ClientKey: id,
      Customer: {
        CurrentAddress: {
          AddressLine1: attrs.address?.addressOne || '',
          AddressLine2: attrs.address?.addressTwo || '',
          City: attrs.address?.city || '',
          State: attrs.address?.state || '',
          Zipcode: attrs.address?.zip || '',
        },
        DateOfBirth:
          `${attrs.dob?.year}-${
